I patrioti che hanno sempre gridato contro i tecnocrati europei oggi sono diventati gli alfieri dell'#austerity, rinunciando, di fatto, a una manovra espansiva che ci avrebbe consentito di investire i settori chiave
Da “siamo pronti” a “siamo proni” è stato un attimo.
@OmnibusLa7

